import { FunctionComponent } from "react";
import Navbar from "../components/navbar";
import ProductTemplate from "../components/ProductTemplate";


type Products = {
  id: number;
  name: string;
  imageSrc: string;
  store: String;
  price: number;
  description: String;
};

const Products = [
  {
    id: 1,
    name: "boAt Smartwaches Starts @999",
    imageSrc: "/61pbjsiyvel-12@2x.png",
    store: "Amazon",
    price: 5999,
    description: "Description of Product 1",
