    imageSrc: "/roobai-546446s1-removebg-preview.png",
    store: "Amazon",
    price: 1299,
    description: "Description of Product 4",
  },
  {
    id: 8,
    name: "Textured PU Leather Stylish Duffle Bags",
    imageSrc: "/roobai-546459s1-removebg-preview.png",
    store: "Amazon",
    price: 1500,
    description: "Description of Product 8",
  }
];



type Desktop3Props = {
  productId: string; // Match the parameter name from the route
};

const Desktop3: FunctionComponent<Desktop3Props> = ({ productId }) => {
  // Fetch the product details based on the productId
  // Assuming you have an array of products, you can filter the product with the matching ID
  const selectedProduct = Products.find(product => product.id.toString() === productId);

  if (!selectedProduct) {
    // Handle the case where no matching product is found
    return <div>Product not found</div>;
  }

  return (
    <div className="relative bg-white w-full h-[1024px] overflow-hidden text-left text-3xl text-darkslategray-100 font-sora">
      <div className="absolute top-[64px] left-[66px] w-[1202px] h-[863px]">
        <ProductTemplate product={selectedProduct} />
      </div>
      <Navbar />
    </div>
  );
};

export default Desktop3;
